import { FC } from 'react';
import { scryRenderedDOMComponentsWithTag } from 'react-dom/test-utils';
import { NavBarBackground, NavBarContainer, ImageContainer, AboutButton } from './NavBar.style';
import { DWMLogo } from './NavBar.style';
import DWMLogoImage from '../../images/DWMLogo.jpg';

interface NavBarProps {
    image_src: string
    border_colour: string
}

export const NavBar: FC<NavBarProps> = ({image_src, border_colour}: NavBarProps) => {

    function NavigateToHomePage() {
        window.location.assign(window.location.origin)
    }
    function NavigateToAboutPage() {
        window.location.assign(window.location.origin + "/AboutPage")
    }
    return (
        <NavBarContainer border_colour= {border_colour}>
            <ImageContainer>
                <NavBarBackground image_src ={image_src}/>
                <DWMLogo src = {DWMLogoImage} onClick = {NavigateToHomePage}/> 
            </ImageContainer>
            <AboutButton>
                <Header>About</Header>
            </AboutButton>

                            {/* <div> */}
                    {/* <HomeButton/>
                    <ConnectButton/> */}
                {/* </div> */}
        </NavBarContainer>
    )
}
